def calculate_y_coordinate(l, d, t):
    md = 10 ** 9 - 7

    def mmul(a, b, adj):
        c0 = (a[0] * b[0] + a[1] * b[1] * adj) % md
        c1 = (a[0] * b[1] + a[1] * b[0]) % md
        return (c0, c1)

    def mpow(b, adj, t):
        rv = (1, 0)
        while True:
            if t % 2 != 0:
                rv = mmul(rv, b, adj)
            t //= 2
            if t == 0:
                return rv
            b = mmul(b, b, adj)
    (y, __) = mpow((d, 1), d ** 2 - l ** 2, t)
    return y * pow(l, 1 - t, md) % md

